import { BrowserRouter as Router, Route } from "react-router-dom";
import AddDepartment from "./components/pages/department/AddDepartment";
import DepartmentList from "./components/pages/department/DepartmentList";
function App() {
  return (
    <div className="container" style={{maxWidth:'600px'}}>
      <br />
      <h4 style={{textAlign:'center'}}>Employee Crud Application Using Django, React and Mongodb </h4>
      <br />
      <Router>
        <div>
          <Route path="/all_department" component={DepartmentList} />
          <Route path="/add_department" component={AddDepartment} />
        </div>
      </Router>
    </div>
  );
}

export default App;
